import React from 'react';
import PaymentForm from '../components/PaymentForm';
import BillingForm from '../components/BillingForm';

const Checkout = () => {
    return (
        <div>
            <h1>Checkout</h1>
            <BillingForm />
            <PaymentForm />
        </div>
    );
};

export default Checkout;
